var listaFilmes = [
	"data:image/jpeg;base64,",
	"data:image/jpeg;base64,",

	"data:image/jpeg;base64,",
	"data:image/jpeg;base64,",
	"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTjNfcWIOlxWJ_MsXfqMB-viExZQPK9siEK_RYx2jBAKkkSe1ZI1tqWdpxUJ0ypGmO9zN8&usqp=CAU"
];

function adicionar() {
	var adicionarFilme = listaFilmes.push(document.getElementById("link").value);
	var novoFilme = document.createElement("img");
	novoFilme.classList.add("filmes");
	novoFilme.src = document.getElementById("link").value;
	document.body.appendChild(novoFilme);
	document.getElementById("link").value = "";
}

for (var indice = 0; indice < listaFilmes.length; indice++) {
	document.write("<img class='filmes' src=" + listaFilmes[indice] + ">");
}